var TXT = [];

function replacePanel(s) {
    let p = deserializePuzzle(s);
    for (let k in p.image) if (p.image[k]?.includes("discordapp")) {
        let oglink = p.image[k].replace(/\\/g, '');
        let filename = oglink.match(/attachments\/\d+\/\d+\/[^?]+/g)?.[0].replace(/^attachments\//, '').replace(/\//g, '_'); 
        p.image[k] = "https://prodzpod.github.io/witness/data/discord/" + filename;
        TXT.push(oglink + " : " + filename);
    }
    return serializePuzzle(p);
}

function replaceSequence(s) {
    return exportSequence(importSequence(s).map(x => replacePanel(x)));
}

var RES = "\n\n";

for (let p of PUZZLES.trim().split('\n')) {
    if (p.startsWith('//')) RES += p + '\n';
    else if (p.startsWith('vs')) RES += replaceSequence(p) + '\n';
    else RES += replacePanel(p) + '\n';
};
var ret = [];
var txt = "";
var imgs = 0;
for (let q of TXT) {
    if (txt.length + q.length >= 1999 || imgs >= 5) { ret.push(txt); imgs = 0; txt = ""; }
    else { txt += q + '\n'; imgs++; }
}
ret.push(txt);
RES += "\n\nIMAGES\n\n" + '\n'
RES += ret.join("\n") + '\n';
RES;